import React, { useEffect } from 'react';
import './App.css';

function App() {
  const subreddit = "memes"
  const url = `https://www.reddit.com/r/${subreddit}/top.json?limit=10`;
  const url2 = `https://www.reddit.com/subreddits/search.json?q=red&limit=10`;

  fetch(url2)
  .then((res) => {
    console.log(res.json());
  })
  .catch((error) => {
    console.log("***ERROR: " + error);
  })


  return (
    <div className="App">

    </div>
  );
}

export default App;
